		   die())",
			"on_talk": "[level.player.store_event('talk_berd_crevice_village', 1),
	          speech_dialog(
	          				set(Berd.animation, 'emote_talk'), 
	          					Berd, [~Ahh, good, you made it\\nthrough there in one piece!~],
							set(level.player.animation, 'emote_geez'),
								level.player, [~Yeah, those goons\\nhad a little ambush set up.~],
							set(level.player.animation, 'emote_talk'),
								level.player, [~So, now what?~],
							set(Berd.animation, 'emote_gesticulate'), 
								Berd, [~Well, Milgram's troops have this half\\nof the town locked down tight.~],
							set(Berd.animation, 'emote_talk'),
								Berd, [~And they also have most of\\nthe residents held prisoner.~],
							set(Berd.animation, 'emote_talk'),
								Berd, [~They're tied up inside the houses, under guard.\\nIf you free them, I'm sure they can help you.~],
							set(level.player.animation, 'emote_nod'),
								level.player, [~Makes sense.~],
							set(Berd.animation, 'emote_gesticulate'),
								Berd, [~Your big problem will be that\\nthe gate connecting the two halves\\nof the town has been locked.~],
							set(Berd.animation, 'emote_wry'),
								Berd, [~And I don't think there's a guard next\\nto it, whom you can steal the key from.~],
							set(Berd.animation, 'emote_confused'),
								Berd, [~In fact I don't think there IS a key.\\nI think that door might be machine-controlled.~],
							set(Berd.animation, 'emote_talk'),
								Berd, [~I don't know where the controls would be,\\nthough.  I'm not from here, after all.~],
							set(Berd.animation, 'emote_gesticulate'),
								Berd, [~Asking one of the prisoners is probably\\nour best bet for a clue.~])
